import React from 'react';
import Head from 'next/head';
import SiteDocument from './_document';

export default class Index extends SiteDocument {
    render () {
        return (
            <div>
                <section>
                    <style jsx>
                        {`
                        
                        section {
                            background-color: #eeeeee;
                        }

                        h1 {
                            color: blue;
                        }

                        `}
                    </style>

                    <h1>Reece Russell</h1>
                    <p>Software Developer</p>
                </section>
            </div>
        )
    }
}
